import React from 'react';
import './home.css';
import axios from "axios";

class Home extends React.Component {
  constructor(){
    super();
    this.state = {
      students : []
    }
  }
  componentDidMount() {
    axios.get("http://127.0.0.1:8000/students/")

  }
  render(){
    return (
      <Navbar bg="dark">
      <Navbar.Brand href="#home">
        <img
          src="/logo.svg"
          width="30"
          height="30"
          className="d-inline-block align-top"
          alt="React Bootstrap logo"
        />
      </Navbar.Brand>
    </Navbar>
    );
  }

}

export default Home;
